root.render(
  <React.StrictMode>

      <form>
        <label>Enter your name:
          <input type="text" id='player-id'/>
        </label>
      </form>
    {/* <Card fname={player.first_name} lname = {player.last_name} number = {player.team.id}/> */}
  </React.StrictMode>
);

const player = getPlayer(document.getElementById("player-id"));

